import React from 'react';
import './App.css';
import logo from './logo.png';


function App() {
  return (
    <div className="container">
      <img src={logo} alt="Logo" style={{ width: '300px', height: '90px', marginBottom: '120px', marginTop: '30px' }} />
      <button className="button">Mint Token</button>
      <button className="button">Sell an Item</button>
      <button className="button">List all items for sale</button>
      <button className="button">Change price of an item</button>
    </div>
  );
}

export default App;
